import React from 'react';

const MessMenu = () => {
  const menuData = {
    breakfast: {
      title: "Breakfast",
      items: "Fried Idly, Vada, Sambar, Coconut Chutney, Omelette (opt)"
    },
    lunch: {
      title: "Lunch", 
      items: "Phulka, White Rice, Kadai Veg, Sambar, Potato-Cabbage Dry, Buttermilk"
    },
    snacks: {
      title: "Snacks",
      items: "Pungulu with Coconut Chutney"
    },
    dinner: {
      title: "Dinner",
      items: "Chicken Gravy / Paneer Butter Masala, Pulao, Mix Dal, Chapathi, Jalebi"
    }
  };

  return (
    <div className="mess-menu">
      <h2>Mess Menu</h2>

      {Object.entries(menuData).map(([key, meal]) => (
        <div key={key} className="meal-section">
          <h3 className="meal-title">{meal.title}</h3>
          <p className="meal-items">{meal.items}</p>
        </div>
      ))}
    </div>
  );
};

export default MessMenu;
